import React from "react";
import Cookies from "js-cookie";


class Home extends React.Component {
    componentDidMount(){
        fetch('/signin').then((res) => res.json())
        .then((result) => {
            this.setState({
                isLoaded: true,
                jwt: Cookies.get('jwt'),
            });
        },)
    }
    render() {
        return <div>{jwt}</div>;
    }
}

export default Home;
